import React from 'react';

const MainPage = () => {
  return (
    <div className="bg-gray-800 text-white p-8 rounded-lg shadow-lg max-w-4xl mx-auto mt-8">
      <h1 className="text-4xl font-bold mb-4">Welcome to DBVision</h1>
      <p className="text-lg text-gray-300">
        Start monitoring your database with interactive charts and real-time updates.
      </p>
    </div>
  );
};

export default MainPage;
